import React from 'react';
import { useSelector } from 'react-redux';
import styled from 'styled-components';
import {Row, Col, Tabs} from 'antd';
import AppLayout from '../components/AppLayout';
// import PostForm from '../components/PostForm';
// import PostCard from '../components/PostCard';

const { TabPane } = Tabs;
const TowerViewSection = styled.div`
  position: relative;
  background : #F6F7F9;
  max-width: 1350px;
  height: 87vh;
  margin: 0 auto;
  padding-top: 30px;
  padding-left: 30px;
  padding-right: 30px;
`;

const SettingSection = styled.div`
  position: relative;
  margin: 0 auto;
  padding-top: 30px;
  padding-inline: 50px;
`;

const CustomTabs = styled(Tabs)`
  .ant-tabs-tab {
    padding-inline : 20px;
  }
  .ant-tabs-tab-btn {
    font-size: 18px;
    margin: 0 auto;
  }
`

const Home = () => {
  // const { isLoggedIn } = useSelector(state => state.user);
  // const { mainPosts } = useSelector(state => state.post);

  return (
    <AppLayout>
      <Row>
        <Col xs={24} sm={24} md={24} lg={14} >
          <TowerViewSection>HI_00</TowerViewSection>
        </Col>
        <Col xs={24} sm={24} md={24} lg={10} >
          <SettingSection>
            <CustomTabs defaultActiveKey="1">
              <TabPane tab="Tower Setup" key="1">
                Content of Tab Pane 1
              </TabPane>
              <TabPane tab="Segment Value" key="2">
                Content of Tab Pane 2
              </TabPane>
              <TabPane tab="ETC." key="3">
                Content of Tab Pane 3
              </TabPane>
            </CustomTabs>
          </SettingSection>
        </Col>
      </Row>
    </AppLayout>
  );
};

export default Home;
